// Function to get the character from the query string
function getCharacterFromURL() {
    const urlParams = new URLSearchParams(window.location.search);
    const characterParam = urlParams.get("character");

    // Find the character matching the "subname : name" format from the URL
    return characterData.find(character => {
        return `${character.subname} : ${character.name}` === characterParam;
    });
}

// Function to update the page with character data
function updateCharacterPage(data) {
    document.getElementById("char-name").innerText = `${data.subname}: ${data.name}`;

    document.getElementById("hp-55").innerText = data.stats.HP_55 || "N/A";
    document.getElementById("hp-100").innerText = data.stats.HP_100 || "N/A";
    document.getElementById("atk-55").innerText = data.stats.ATK_55 || "N/A";
    document.getElementById("atk-100").innerText = data.stats.ATK_100 || "N/A";
    document.getElementById("def-55").innerText = data.stats.DEF_55 || "N/A";
    document.getElementById("def-100").innerText = data.stats.DEF_100 || "N/A";

    if (data.leaderSkill) {
        document.getElementById("leader-skill").innerText = data.leaderSkill;
        document.getElementById("leader-skill-container").style.display = "block";
    }

    if (data.passiveSkill) {
        document.getElementById("passive-skill").innerText = data.passiveSkill.name;
        document.getElementById("passive-skill-container").style.display = "block";
    }

    if (data.superAttack12Ki) {
        document.getElementById("super-attack-12-ki-name").innerText = data.superAttack12Ki.name;
        document.getElementById("super-attack-12-ki-effect").innerText = data.superAttack12Ki.effect;
        document.getElementById("super-attack-12-ki-container").style.display = "block";
    }

    // Continue for other sections (super attack, ultra super attack, etc.)
}

// Fetch the character data from the URL and update the page
const character = getCharacterFromURL();
if (character) {
    updateCharacterPage(character);
} else {
    // Handle case if character is not found in the data
    console.error("Character not found");
}